import React from "react";
import "@blueprintjs/core/lib/css/blueprint.css";
import { Card, Classes } from "@blueprintjs/core";

function Info() {
    return (
        <div
            style={{
                margin: 30,
            }}
        >
            <Card className={Classes.ELEVATION_3}>
                <h1>Home Page</h1>

                <p>This Page is about Home of the company</p>
            </Card>
        </div>
    );
}

export default Info;
